using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Epam.FinalTask.PhotoAlbum.DAL.Contracts;
using Epam.FinalTask.PhotoAlbum.Entities;

namespace Epam.FinalTask.PhotoAlbum.FakeDAL
{
    public class FakeAvatarsDao : IAvatarsDao
    {
        private static readonly int defaultAvatarId = 1;

        private readonly IUsersDao usersDao;

        private static int avatarId = 2;

        private List<Avatar> avatars;

        public FakeAvatarsDao(IUsersDao usersDao)
        {
            this.usersDao = usersDao;

            this.avatars = new List<Avatar>
            {
                {
                    new Avatar
                    {
                        AvatarId = defaultAvatarId,
                        AvatarData = "",
                        MimeType = "image/jpeg",
                    }
                }
            };
        }

        public Avatar GetUserAvatarByUserName(string userName)
        {
            User user = this.usersDao.GetUserByUserName(userName);

            return this.avatars.First(a => a.AvatarId == user.UserAvatarId);
        }

        public void SetDefaultAvatar(Avatar avatar)
        {
            avatar.AvatarId = defaultAvatarId;
            this.avatars[0] = avatar;
        }
    }
}
